(513, 1, 1, 'Homepage', 'Homepage', '<div class="row">\r\n    <div class="span1"><img src="assets/img/multilangual.png"></div>\r\n    <div class="span3">\r\n<h4>Native Multilangual</h4>\r\nNatively multilingual, no need to install any addon.\r\nEvery element can be translated and you can add as many languages as you want.\r\n</div>\r\n    <div class="span1"><img src="assets/img/easy_customize.png"></div>\r\n    <div class="span3">\r\n<h4>Easy to customize</h4>\r\nApplication is based on CodeIgniter PHP framework, if you know CodeIgniter you can easily customize the system.\r\n</div>\r\n    <div class="span1"><img src="assets/img/bootstrap.png"></div>\r\n    <div class="span3">\r\n<h4>Bootstrap ready</h4>\r\nBackend and Frontend based on Bootstrap and are easy to customize.\r\n</div>\r\n</div>\r\n<div class="row">\r\n    <div class="span1"><img src="assets/img/drag-drop.png"></div>\r\n    <div class="span3">\r\n<h4>User friendly</h4>\r\nWebsite structure is logical.\r\nManaging elements such as pages, estates or images is easily done by drag''n''drop!\r\n</div>\r\n    <div class="span1"><img src="assets/img/template.png"></div>\r\n    <div class="span3">\r\n<h4>Template System</h4>\r\nEasy to use CodeIgniter Template Parser Class or alternative PHP syntax available.\r\n</div>\r\n    <div class="span1"><img src="assets/img/robust.png"></div>\r\n    <div class="span3">\r\n<h4>Robust</h4>\r\nBuild as easy to use and robust Metro style Admin user interface\r\n</div>\r\n</div>\r\n<p> </p><br>\r\n<p> </p>', '', '', 'homepage'),
(514, 1, 2, 'Naslovnica', 'Naslovnica', '<div class="row">\r\n    <div class="span1"><img src="assets/img/multilangual.png"></div>\r\n    <div class="span3">\r\n<h4>Prirodna višejezičnost</h4>\r\nPrirodno podržana višejezičnost, bez potrebe za dodacima.\r\nSvaki element može biti preveden i moguće je dodavati jezike po želji.\r\n</div>\r\n    <div class="span1"><img src="assets/img/easy_customize.png"></div>\r\n    <div class="span3">\r\n<h4>Prilagodljiv</h4>\r\nAplikacija bazirana na CodeIgniter PHP frameworku, ako ste upoznati s  CodeIgniterom lako ćete modificirati sustav.\r\n</div>\r\n    <div class="span1"><img src="assets/img/bootstrap.png"></div>\r\n    <div class="span3">\r\n<h4>Bootstrap ugrađen</h4>\r\nAdministracija i klijentska stranica bazirana na Boostrtapu i jednostavna za prilagodbu.\r\n</div>\r\n</div>\r\n<div class="row">\r\n    <div class="span1"><img src="assets/img/drag-drop.png"></div>\r\n    <div class="span3">\r\n<h4>Jednostavan<br></h4>\r\nStruktura webstranice jasna.\r\nUpravljanje elementima poput stranica, nekretninama ili slikama jednostavna pomoću drag''n''drop!\r\n</div>\r\n    <div class="span1"><img src="assets/img/template.png"></div>\r\n    <div class="span3">\r\n<h4>Sustav predložaka</h4>\r\nJednostavan CodeIgniter Template Parser Class ili alternativna PHP syntax-a podržana.\r\n</div>\r\n    <div class="span1"><img src="assets/img/robust.png"></div>\r\n    <div class="span3">\r\n<h4>Robustan</h4>\r\nRazvijen da buje jednostavan i izgledom robustan, ugrađeno Metro style Admin sučelje\r\n</div>\r\n</div>\r\n<p> </p><br>\r\n<p> </p>', '', '', 'naslovnica');
