(311, 22, 1, 'Winnipeg', 'Manitoba - Winnipeg', 'Winnipeg', '', 'Winnipeg', '<h3><a name="History" id="History">History </a></h3>\r\n                <p>The history of Alexandra Park is one  that was initiated by a Polish Engineer. For some time, the biggest symbol of  the neighborhood was the grand home called “The Hall”. After the development of  The Hall came developments for Polish and Ukrainian immigrants around the  1920’s and 1930’s. In the 1960’s the hall was demolished to make way for public  housing. The Area started to slowly be inhabited by Chinese, Vietnamese, East  Africans and Caribbeans. </p>\r\n                <p>The neighborhood started to grow violent around the  1970’s with the uprising of the infamous African Canadian gang called the  Project Originals. Drugs quickly became a problem and it wasn’t too long before  members of the community turned to the government for redevelopment. With the  help of the Toronto Community Housing Corporation, the neighbourhood is on the  road to a bright future and endless opportunity. </p>\r\n<h3><a name="Lifestyle">Lifestyle</a></h3>\r\n<p>Generally located in between Dundas St  W and Queen St W from north to south, and Spadina Ave to Bathurst St from east  to west, Alexandra &nbsp;Park is famous for its convenience and variety. A  mixture of residential, commercial, and institutional buildings line the  neighbourhoods’ many streets. However, there is also the 2.7 hectare Alexandra  Park, the neighbourhoods’ namesake, which includes a community garden, a  baseball diamond, an outdoor pool, and even an artificial ice skating rink. The  park is a picturesque and convenient escape for those looking to escape the  hustle and bustle of daily city life. </p>\r\n<p>As detailed below under Housing, the  neighbourhood of Alexandra Park is undergoing a mass residential overhaul, with  an aim to improve the quality of life for those most in need. While much of the  focus has been on the housing fixes, additions, and other residential  development, there is much more to look forward to for this Toronto  neighbourhood. </p>\r\n<p>There is to be retail space added the  ground level of building developments, in order to provide residents with  shopping alternatives to add to the nearby Kensington Market and Chinatown.  Shopping in those districts is another advantage of life in Alexandra Park.  Residents can also feel excitement for two brand new parks and new streets. The  once secluded community can potentially become an integral part of Toronto. </p>\r\n<h3><a name="Housing">Housing </a>				</h3>\r\n				<p>Houses in the Alexandra park  neighborhood tend to be more Victorian Style. They date back as far as the  1880’s. Bungalos are common in the neighborhood. A few semi-detached houses  exist as well but the most popular type of houses are townhouses due to the  developments of the Park Housing Cooperative. Prices of the privately owned  houses can range anywhere from $200,000-$600,000. </p>\r\n				<p>Future plans for the  neighborhood involving the Toronto Community Housing Corporation see extensive  redevelopment, including razing and replacement of over 300 subsidized  townhouses and apartments, refurbishment of nearly 500 subsidized apartments,  and the addition of more 1,500 units at market value. Such exciting prospects  can potentially lead to Alexandra Park, amongst the city’s worst neighbourhoods  in the 1990s, becoming one of its most desirable. </p>', 'winnipeg', 'winnipeg', 'winnipeg', 'ad1', 'ad2', 'ad3', '', '', ''),
(312, 22, 2, 'Winnipeg', 'Manitoba - Winnipeg', 'Winnipeg', '', 'Winnipeg', '<h3><a name="History" id="History">History </a></h3>\r\n                <p>The history of Alexandra Park is one  that was \r\ninitiated by a Polish Engineer. For some time, the biggest symbol of  \r\nthe neighborhood was the grand home called “The Hall”. After the \r\ndevelopment of  The Hall came developments for Polish and Ukrainian \r\nimmigrants around the  1920’s and 1930’s. In the 1960’s the hall was \r\ndemolished to make way for public  housing. The Area started to slowly \r\nbe inhabited by Chinese, Vietnamese, East  Africans and Caribbeans. </p>\r\n                <p>The neighborhood started to grow violent around the  \r\n1970’s with the uprising of the infamous African Canadian gang called \r\nthe  Project Originals. Drugs quickly became a problem and it wasn’t too\r\n long before  members of the community turned to the government for \r\nredevelopment. With the  help of the Toronto Community Housing \r\nCorporation, the neighbourhood is on the  road to a bright future and \r\nendless opportunity. </p>\r\n<h3><a name="Lifestyle">Lifestyle</a></h3>\r\n<p>Generally located in between Dundas St  W and Queen St W from north \r\nto south, and Spadina Ave to Bathurst St from east  to west, Alexandra \r\n&nbsp;Park is famous for its convenience and variety. A  mixture of \r\nresidential, commercial, and institutional buildings line the  \r\nneighbourhoods’ many streets. However, there is also the 2.7 hectare \r\nAlexandra  Park, the neighbourhoods’ namesake, which includes a \r\ncommunity garden, a  baseball diamond, an outdoor pool, and even an \r\nartificial ice skating rink. The  park is a picturesque and convenient \r\nescape for those looking to escape the  hustle and bustle of daily city \r\nlife. </p>\r\n<p>As detailed below under Housing, the  neighbourhood of Alexandra Park\r\n is undergoing a mass residential overhaul, with  an aim to improve the \r\nquality of life for those most in need. While much of the  focus has \r\nbeen on the housing fixes, additions, and other residential  \r\ndevelopment, there is much more to look forward to for this Toronto  \r\nneighbourhood. </p>\r\n<p>There is to be retail space added the  ground level of building \r\ndevelopments, in order to provide residents with  shopping alternatives \r\nto add to the nearby Kensington Market and Chinatown.  Shopping in those\r\n districts is another advantage of life in Alexandra Park.  Residents \r\ncan also feel excitement for two brand new parks and new streets. The  \r\nonce secluded community can potentially become an integral part of \r\nToronto. </p>\r\n<h3><a name="Housing">Housing </a>				</h3>\r\n				<p>Houses in the Alexandra park  neighborhood tend to be more \r\nVictorian Style. They date back as far as the  1880’s. Bungalos are \r\ncommon in the neighborhood. A few semi-detached houses  exist as well \r\nbut the most popular type of houses are townhouses due to the  \r\ndevelopments of the Park Housing Cooperative. Prices of the privately \r\nowned  houses can range anywhere from $200,000-$600,000. </p>\r\n				<p>Future plans for the  neighborhood involving the Toronto \r\nCommunity Housing Corporation see extensive  redevelopment, including \r\nrazing and replacement of over 300 subsidized  townhouses and \r\napartments, refurbishment of nearly 500 subsidized apartments,  and the \r\naddition of more 1,500 units at market value. Such exciting prospects  \r\ncan potentially lead to Alexandra Park, amongst the city’s worst \r\nneighbourhoods  in the 1990s, becoming one of its most desirable. </p>', 'winnipeg', 'winnipeg', 'winnipeg1', '', '', '', '', '', '');
